import React from 'react';
import ReactDOM from 'react-dom/client';
import { Provider } from 'react-redux';
import App from './App';
import { APIContextProvier } from './store/APIContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <APIContextProvier>
      <App />
    </APIContextProvier>
  </React.StrictMode>
);
